import React from "react";
//import Button from "@mui/material/Button";
import Box from "@mui/material/Box";
import { Button } from "@mui/material";
import Stack from "@mui/material/Stack";
import "./Wallet.css";

const Wallet = () => {
  return (
    <>
      <Box
        sx={{
          width: 500,
          height: 300,
          backgroundColor: "gray",
          marginTop: 30,
          marginLeft: 45,
        //   marginRight:15,
          // marginBottom:10,
          alignContent:"center",
          justifyContent:"center"
        }}
      >
        <h1 className="heading">Wallet Connection</h1>
        <Stack spacing={5} direction="column" marginLeft={20} marginTop={10} width={180} alignContent="center" >
          <Button variant="contained" onClick={() => {
              alert("connected");
            }} className="wallet">
            Wallet Connection
          </Button>
          <Button
            variant="contained"
            onClick={() => {
              alert("skipped");
            }}
          >
            Skip
          </Button>
        </Stack>
      </Box>
    </>
  );
};
export default Wallet;
